import React, { Component } from 'react';
import '../cssFiles/FarmerPage.css'; 

const farmProducts = [
  { id: 1, name: 'Cow Husbandry', price: ' ₹10', imgSrc: 'path/to/image1.jpg' },
  { id: 2, name: 'Cow Husbandry', price: ' ₹15', imgSrc: 'path/to/image2.jpg' },
  { id: 3, name: 'Chick Poultry', price: ' ₹20', imgSrc: 'path/to/image3.jpg' },
  { id: 4, name: 'Goat Shed', price: ' ₹10', imgSrc: 'path/to/image1.jpg' },
  { id: 5, name: 'Duck Poultry', price: ' ₹15', imgSrc: 'path/to/image2.jpg' },
  { id: 6, name: 'Fish Pond', price: ' ₹20', imgSrc: 'path/to/image3.jpg' },
];

class FarmerPage extends Component {
  render() {
    const rows = [];
    const productsPerRow = 3;

    farmProducts.forEach((product, index) => {
      if (index % productsPerRow === 0) {
        rows.push([]);
      }
      rows[rows.length - 1].push(product);
    });

    return (
      <div className="farmer-page">
        {rows.map((row, rowIndex) => (
          <div key={rowIndex} className="row">
            {row.map(product => (
              <div key={product.id} className="card">
                <img src={product.imgSrc} alt={product.name} />
                <h3>{product.name}</h3>
                <p>Price: {product.price}</p>
              </div>
            ))}
          </div>
        ))}
      </div>
    );
  }
}


export default FarmerPage;
